import React, { Component } from 'react';

class App extends React.Component{
    constructor(){
        super();
        this.state = {
            songs: []
        }
    }

    callAPI(){
        fetch('http://localhost:5000/posts')
        .then(res => res.json())
        .then(songs => this.setState({songs}, () => console.log('songs fetched',songs)));
        //.then(songs => this.setState({songs}));
        
        //.then(res => this.setState({apiResponse: res}))
        //.catch(err => err);
    }

    componentDidMount(){
       /* fetch("http://localhost:5000/posts")
        .then(res => res.json())
        .then(songs => this.setState({ songs }));*/
        this.callAPI();
    }

    render() {
        return (
            <div className="Spotters">
                <h1>This is a react app</h1>
                 <ul>
                     {this.state.songs.map(song =>
                         <li key={song.MusicID}>{song.SongName}</li>
                        )}
                 </ul>
            </div>
        );
    }
}

export default App;
